p.push(T.azM("https://flaeckegosler.ch/site/assets/files/2516/img_3002.-thumbnail.jpg","",C.e.j(0),"","/images/mock/img_3002.jpg","Janick Lang","<p>Lange mussten die Gosler sich gedulden. Mehr als eineinhalb Jahre vergingen seit dem letzten Gosler-Wochenende. Nun war es jedoch endlich wieder soweit.</p>","<p>Die feuchtfr\xf6hliche Hinfahrt \xfcber den Hirzel machte jedoch nicht etwa schwachen M\xe4gen zu schaffen, sondern dem Car. Dieser entschied sich kurzerhand f\xfcr ein verfr\xfchtes Wochenende und ein Ersatz musste her. Die Gosler Truppe machte es am Strassenrand in der Abendsonne bequem und das aus Einsiedeln stammende Carunternehmen organisierte einen neuen fahrbaren Untersatz. In der Fuederegg angekommen wurden dann die hungrigen M\xe4uler mit k\xf6stlichem Schnippo im Restaurant versorgt. Bis in die fr\xfchen Morgenstunden wurde getanzt, gelacht, gejasst und das Zusammensein genossen.</p> <p>Nach einigen erholsamen Stunden Schlaf in der Unterkunft Rittersporn, galt es sich mit Fr\xfchst\xfcck in fester oder fl\xfcssiger Form zu st\xe4rken. Bei strahlender Sonne wurden die auf Hochglanz polierten Instrumente von den letzten Staubk\xf6rnern befreit. Endlich ert\xf6nten wieder Guggenmusikalische Kl\xe4nge, auch zur Freude von vielen Wanderern, welche das unerwartete Platzkonzert genossen. Ein sichtlich zufriedener Tambi er\xf6ffnete dann das Sandwich Buffet. Die n\xe4chste St\xe4rkung war angesagt, um am Nachmittag beim Gastspiel vor dem Restaurant mit brillanten T\xf6nen gl\xe4nzen zu k\xf6nnen. Nach einem erfolgreichen Auftritt wurde der Spielplatz in Beschlag genommen und ein Apero genossen. Viele erhofften sich, den (Sonnen)-Brand von innen heraus l\xf6schen zu k\xf6nnen und mussten eines Besseren belehrt werden. In einem anschliessenden Beerpong Turnier konnte die Treffsicherheit unter Beweis gestellt werden. Da das Wetter jedoch andere Pl\xe4ne hatte, musste der an Spannung kaum zu \xfcberbietende Wettkampf abgebrochen werden. Gest\xe4rkt von k\xf6stlichen \xc4lplermagronen ging dann ein gem\xfctlicher Abend im Aufenthaltsraum \xfcber die B\xfchne. Einzig ein paar Tanzw\xfctige wagten sich in das nasskalte Wetter hinaus.</p> <p>Das Programm am Sonntag gestaltete sich je nach Gem\xfctslage. Einige liessen sich von der Aussicht in die H\xf6he locken. Andere wollten verpasste Duelle im Beerpong nachholen. Sp\xe4testens als sich der Geruch von grillierten Bratw\xfcrsten im Hoch Ybrig verbreitete, trudelten alle wieder in der Unterkunft ein und brachten diese wieder auf Vordermann. Nach einer Heimfahrt, auf welcher unser Chauffeur mit unz\xe4hligen Fakten und Geschichten \xfcber die an uns vorbeiziehende Landschaft gl\xe4nzte, stiegen die Gosler ersch\xf6pft aber gl\xfccklich in Rothenburg aus dem Car und machten sich auf den Nachhauseweg.</p> <p>#HedsNoBr\xe4nd #NornoAchtBillet #Dr\xe4ckImTank #NummeroUno #Super\xc4rnst</p>","","Sommerausflug Fuederegg","Montag, 12.07.2021 22:30",1626121843))
p.push(T.azM("https://flaeckegosler.ch/site/assets/files/2514/whatsapp_image_2021-06-27_at_22_08_48_1-1.-thumbnail.jpeg","https://flaeckegosler.ch/fotos/gv-2021/gv-2021/",C.e.j(1),"","/images/mock/whatsapp_image_2021-06-27_at_22_08_48_1-1.jpeg","Reto B\xe4ttig","<p>Am Samstag, 26. Mai 2021 fand die 31. ordentliche Generalversammlung der Guuggemusig Fl\xe4ckegosler Roteborg statt.</p>",'<p>Um 14:00 Uhr durfte ich meine letzte Generalversammlung der Fl\xe4ckegosler im Saal des Gasthaus Bahnhof zu Rothenburg er\xf6ffnen. Wie sch\xf6n war es f\xfcr mich und alle Mitgosler endlich wieder mal alle Leute zu treffen, interessante Gespr\xe4che abzuhalten und nat\xfcrlich auch gen\xfcgend (fl\xfcssige) Nahrung zu uns zu nehmen \u2013 wie haben wir das vermisst! Gerade f\xfcr einen so geselligen Haufen wie wir es sind, war diese Zeit ein Stich in\u2019s Herz.</p> <p>Auf Grund des speziellen Jahres entschied die Generalversammlung auf Antrag des Vorstandes, dass die angehenden Kandidaten in ein zweites Kandidatenjahr geschickt werden, damit sie einerseits uns Fl\xe4ckegosler \xabrichtig\xbb begegnen k\xf6nnen und andererseits wir Fl\xe4ckegosler die Kandidaten richtig kennenlernen k\xf6nnen.</p> <p>Nach den \xfcblichen - aber f\xfcr dieses Jahr doch erstaunlich detaillierten - Jahresberichten vom Tambi Oli Sch\xfcrch, Sujetchef Diego Zimmermann und meiner Wenigkeit gingen wir direkt \xfcber zu den Finanzen, pr\xe4sentiert von Alex Vogel. Dank grossz\xfcgigen G\xf6nnerbeitr\xe4gen konnten wir den Verlust gut in Grenzen halten \u2013 dankesch\xf6n f\xfcr eure Treue auch in diesem Jahr!</p> <p>Ich war heilfroh, dass ich in meinem letzten Amtsjahr bloss einen Austritt verk\xfcnden musste, dieser betrifft unser langj\xe4hrigen Aktuar Jos\xe9 St\xe4hlin, welcher sein Amt als Aktuar abgibt und sogleich aus dem Verein austritt. Danke Jos\xe9 f\xfcr deinen Einsatz und du weisst, dass Gosler die T\xfcren nie schliessen! F\xfcr seinen Posten wurde Nick Leber von der Generalversammlung einstimmig gew\xe4hlt. Da wir bloss einen Austritt zu beklagen haben, sind wir Fl\xe4ckegosler nat\xfcrlich bestens ger\xfcstet f\xfcr die n\xe4chste Fasnacht \u2013 so Corona will.</p> <p>Wie ihr schon aus den ersten Zeilen mitbekommen habt, habe auch ich mein Amt als Pr\xe4sident der Guuggemusig Fl\xe4ckegosler Roteborg abgegeben \u2013 leider blieb es mir verwehrt mein letztes Pr\xe4sidialjahr zu zelebrieren. Nichtsdestotrotz schaue ich mit viel Freude und Stolz auf meine 4 Jahre Pr\xe4sident dieses einzigartigen Vereines zur\xfcck \u2013 der Verein forderte mich extrem heraus aber gab auch so unglaublich viele sch\xf6ne Momente zur\xfcck. Ich habe mich bereits letzten Sommer zu diesem Schritt entschieden, da mich der Beruf sehr beansprucht und der Verein wieder neue Impulse ben\xf6tigt. In dem Sinne m\xf6chte ich allen Goslerfreunden DANKE sagen f\xfcr eure Unterst\xfctzung, eure Feedbacks, die Teilnahme an unseren Anl\xe4ssen und grunds\xe4tzlich die wunderbaren Begegnungen. Wie wichtig einem solche Begegnungen sind, wurde jeder/m in diesem Jahr vor Augen gef\xfchrt. Ein besonderer Dank geht an alle Roteborger Fasnachtsvereine f\xfcr die konstruktive und zielgerichtete Zusammenarbeit, diese wurde meinerseits stets sehr gesch\xe4tzt und es war wunderbar zu sehen, wie wir hier zusammen mehr erreichen konnten.</p> <p>Der Vorstand hat der Generalversammlung Janick Lang als neuen Pr\xe4sident vorgeschlagen und dieser wurde einstimmig und unter Applaus gew\xe4hlt. Nach einer kleinen Pr\xe4sent\xfcbergabe und seiner Amtseinf\xfchrungsansprache durfte er auch bereits das Jahresprogramm f\xfcr das neue Vereinsjahr pr\xe4sentieren \u2013 wir Fl\xe4ckegosler planen mit einem einzigen Virus: Dem Fasnachtsvirus. Janick \u2013 ich w\xfcnsche dir nur das Beste f\xfcr deine Amtszeit und bin selbstverst\xe4ndlich stets zu deinen Diensten! Ich bin der vollen \xdcberzeugung, dass du der w\xfcrdige Nachfolger von mir bist f\xfcr dieses ehrenhafte Amt!</p> <p>Die restlichen Mutationen in den \xc4mtern werden dann zeitnah auf der Homepage hochgeschalten.</p> <p>Nach dem offiziellen Teil der Generalversammlung durften wir einen Ap\xe9ro im Restaurant Bahnhof geniessen bevor wir dann kulinarisch verw\xf6hnt wurden von Pirmin mit Isabelle und Team \u2013 Dankesch\xf6n! Was nach dem Essen noch alles stattfand, m\xf6chte ich hier nicht im Detail erl\xe4utern, aber wir kamen definitiv alle (wohl) desinfiziert nach Hause! Bilder vom offiziellen Teil findet ihr <a href="https://flaeckegosler.ch/fotos/gv-2021/gv-2021/">hier</a>, die Bilder vom inoffiziellen Teil sind h\xf6chstens noch in der Erinnerung einiger Gosler</p> <p>#sengemereis #WGPartycrasher #imst\xe4gehuuslegge #Schl\xf6sselbeiweg #fl\xe4scheworf #appezellerbronne #tanzederno #schlofeofemSofa #falschischuehmetheignoh #pizzaautomat #falschezogverw\xf6tscht</p> <p>In dem Sinne m\xf6chte ich mich als Pr\xe4sident von euch verabschieden, mich bedanken und nat\xfcrlich freue mich wahnsinnig eine Reihe nach hinten zu kehren und die Fasnacht 2022 als normales Mitglied zu zelebrieren! Dankesch\xf6n ond en sch\xf6ne Sommer,</p> <p>Reti (Ex-Pr\xe4sident Fl\xe4ckegosler Roteborg)</p>',"","Bericht zur 31. Generalversammlung der Guuggemusig Fl\xe4ckegosler Roteborg","Sonntag, 04.07.2021 00:00",1625349600))
p.push(T.azM("https://flaeckegosler.ch/site/assets/files/2504/samschtig-1.-thumbnail.jpeg","",C.e.j(2),'Ein Selfie eines Mitgliedes der Gruppe "Tha(mpon) WG". (Foto: Patrick Roos)',"/images/mock/samschtig-1.jpeg","Chantal Fischer, Julia Lipp","<p>An unserem bereits letzten Fasnachtstag der Fasi 2021 hat der Vorstand eine Schnitzeljagd durch Rothenburg organisiert. Am Abend war dann leider schon der digitale Abschluss.</p>","<p>Am Maschgerelauf sind wir Gosler*innen in unseren supertollen 5er Gruppen gestaffelt auf zwei verschiedenen Routen an die Schnitzeljagd angetreten. Mit mehr oder weniger sch\xf6nen Verkleidungen haben wir trotz allem noch ein wenig Fasnacht und Kreativit\xe4t nach Rothenburg gebracht.</p> <p>Bei einem Fotoshooting, corona-konformem Bierpong, Dart, legend\xe4ren Theaterst\xfccken und einem Schn\xe4psli-Ratespiel haben wir alle unser K\xf6nnen gezeigt und \xfcbelscht viel Spass gehabt. Die abartigen Minustemperaturen haben uns, wenn man nicht komplett blau war, riesig ins Schlottern gebracht.</p> <p>Dank einer bezeli m\xfchsamen, seeeehr langsamen, aber lustigen Gruppe (die hie und da auch ein wenig geschummelt hat), wurde es dem Vorstand bestimmt nicht langweilig. Sie als Organisatoren haben uns ein lustiges Programm vorbereitet, das uns als Teilnehmende top organisiert r\xfcber kam.</p> <p>Nach einem feinen Znacht in unseren supertollen 5er Gruppen, begann das (HOFFENTLICH F\xdcR IMMER) letzte Fasnachts-Zoommeeting. Wir durften \xfcber die beste Verkleidung vom Maschgerelauf abstimmen und haben uns die Videos von den legend\xe4ren Theaterst\xfccken angeschaut. Wegen den T\xfccken der Technik haben wir leider nicht so viel von den eingespielten Videos mitbekommen \u2013 ausser, dass Oli einen Knutschfleck von einem Karpfen hat und deswegen sein Date mit der netten jungen Dame vermiest wurde.</p> <p>Dann war es leider schon so weit: Das letzte Fasnachtsst\xfcndli hat geschlagen und der Vorstand beendete das offizielle diesj\xe4hrige Fasnachtsprogramm.</p> <p>Auf eine bessere, r\xfc\xfcdige, gesellige, analoge, reale, soum\xe4ssiggute und laute Fasnacht 2022!</p>","","Fl\xe4ttere-Samschtig","Samstag, 13.02.2021 00:00",1613170800))
